import React, { Component } from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Hidden from '@material-ui/core/Hidden';
import {Link} from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import IconButton from '@material-ui/core/IconButton';
import Button from '@material-ui/core/Button';
import MenuIcon from '@material-ui/icons/Menu';

var r = 120

window.addEventListener('resize', function(){
	if (parseInt(window.innerWidth) === 320)
	{
		r = parseInt(window.innerWidth) - 240;
		console.log(r)

	}
	if (parseInt(window.innerWidth) === 360)
	{
		r = parseInt(window.innerWidth) - 260;

		console.log(r)

	}
})




const useStyles = makeStyles((theme) => ({
	title: {
		paddingLeft : '20px',
		flexGrow : 1,
	},
	Mobileicon: {
		paddingLeft :  80+'px',
		flexGrow : 1,
	}

}));






function NavBar(){
	const classes = useStyles();

		return (

			<AppBar position = 'static' style={{background : '#B0DFE5'}}>
				<Toolbar>
					<Hidden xsDown>

					<Link to='/' className="brand-logo"><img src="./laptop_ng.png" /></Link>

					<Typography variant="h6" color='inherit' className={classes.title}>
						<Link to='/' className="brand-logo" style={{color : 'inherit'}}>LaptopNG</Link>
					</Typography>

					</Hidden>
					<Hidden smUp>

						<IconButton edge="start">
							<MenuIcon />
						</IconButton>

						<Typography className={classes.Mobileicon}>
							<Link to='/' className="brand-logo"><img src="./laptop_ng.png" /></Link>
						</Typography>

					</Hidden>

					<Button color='inherit'>
						<ShoppingCartIcon />
					</Button>

				</Toolbar>
			</AppBar>


			);


}

export default NavBar
